■フルHDドライビングレコーダー 「ドライブマン 1080」
フルハイビジョン画像のドライブレコーダー登場！
ドライブレコーダー共通の問題点である、LED信号機の灯りが同期して数秒消える現象を改善しました！
関東、関西のLED信号機の同期問題に対し対策済み。
※LED信号自体が点滅していますので、条件により高速で点滅して写ります。
■アサヒリサーチ株式会社製　自動車車載用常時録画式ドライブレコーダー
■全ての事故が記録できる事を保証した製品ではありません。万が一、映像が記録されなかった場合や、記録したデータが破損した場合などについても弊社は一切責任を負いません。
■1920ｘ1080のフルハイビジョン映像　※1280ｘ720のハイビジョンに切り替え可能
■付属の8GB SDHCカードに記録
■エンジンACC電源連動　エンジンを回すと同時に録画を開始します。
■常時録画
■MOVファイルフォーマット。HDMI対応フルハイビジョンTVで再生可能。
※録画映像のパソコンでの利用はサポート対象外で再生ソフトも付属しません。利用可能なPCはSDHC規格のカード対応でフルHD再生が可能な高度なビデオ処理能力のあるPCに限ります。
■1つのファイルは5分単位。録画時間に応じて記録ファイルが増えます。
■カードの容量が一杯になると、古いファイルに上書きするエンドレス記録
■付属のカードで約2時間の録画。上書きされますので必要な場合はカードを保存して下さい。<style type="text/css">
